5Y21NFED1BJz9O9M7a09ptHmiUa03KsxyfhS+\ncurEsiAgn8pztRyET6lGaZZNKOm5wBjJ+Ypva20dtaPN+HPcgHGrA3wNsfShLCxuZbY3POR9oww2\nGepraz4jYRTRx3AeOaCMrhAT5ict8uVcflv8nB4TLh/LDrJBOon4hbRxzRkYyew2OOhpml/C7BNY\nG256Unup/aYS0JzCQWzg4IH8qzsLaaddasDvvuemN65tdclq+M+OrOijECa5kRS782A3PxNUM4Zv\nJj4cqrDFpXKnbtV9CNvimVQJMrUWVZ356Tg8xmswNXvDbPStWi057GqFE0gbZ5470rV2MJnJk0a6\njv8A/wBmpWumL/jUrfGNs4BkLb6+vXPSoF6ZG3xqVK9SSlQgzhWAOPWqGLU2M9alStNMZIgvvbH0\noVzGv5vsalSjFZkzqv5vsaefspc5uZ7bVkMusbdRsf0qVK0W3qdM0A3xzFCtbZbynY881KlBiEyF\nr5vOas1rEy8vTFSpWmgzcLj3YD+1SPhi5xq3+1SpWybZV+HpHgr3rSOx1HLYC+nOpUrTTaS09mII\nAO2c01gUXVhhdiP51KlEmZlNxNOF2zG4JIXlgZJ35f5tXM3/ABi74iTGD4EDf9NTuw9T+lSpRjVO\nykUEfhqqqgYczjNERxPGvlZcc/dHSpUrShCVXQuTNt12rQMi2zz+O+Vk0ABRvsP61KlbIFZVL+TQ\nrQIxDc9TD7Vkkk1zfxwzRKBuxGxyBvjNSpSeTlWE9kdcHgmKyTXQjwSfDAJJQMd1Pzq68OtYrt7m\nKEeK/UknG2+KlSvNHkZDYXNbCVdWyr2G3zqkdp4BxE5BX6GpUrIRhchAldj09RROV0g49alShVhT\n1K51nynBrNoA0iO+S0ZOk59N6lSnIv3Jj1H0qVKlCPP/2Q==\n\",\"preparation\":\"firstly, in a large mixing bowl take 2 cup maida,  tsp baking soda and 1 tsp baking powder and  tsp salt. mix well.\r\nadd 2 tbsp oil,  cup curd and 1 tsp garlic.\r\nmix well making sure everything is well combined.\r\nfurther, add water as required and knead to a smooth and soft dough.\r\ngrease the dough with oil, cover and rest for 2 hours.\r\nmeanwhile prepare garlic butter by mixing 3 tbsp butter, 1 tsp garlic and 2 tbsp coriander.\r\nafter 2 hours, knead the dough slightly. to remove if any air present in the dough. pinch a ball sized dough.\r\ngently roll to oval shape using a rolling pin. make sure you do not make too thin nor thick. and also keep the size in mind. it should not be larger than your tawa size.\r\ngrease with water over naan. make sure you coat uniformly. this helps naan to stick on tawa.\r\nfurthermore, slowly flip over and put it on hot tawa. remember, be gentle and put the water coated side down to tawa. also do not use nonstick tawa.\r\nslightly press. this helps the naan to stick on to the tawa and when you flip the tawa upside down it will be intact.\r\nnow after a minute, flip the tawa upside down and cook naan directly on flame till they turn golden brown.\r\nalso brush with some prepared garlic butter mixed with coriander leaves.\r\ngently scrape the naan from the bottom and remove.\r\nfinally, serve garlic naan hot with your favourite curry like mattar paneer.\r\n\"}]}', '', '', '', '', '', '');
INSERT INTO `food_data_base_for_diet_chart` (`name`, `calorie`, `description`, `nutrients`, `ingredients`, `photo`, `category`, `preparation`) VALUES
('dosa', 112, 'A dosa / dosai / dosey is a thin batter-based dish (usually crispy) originating from South India, made from a fermented batter predominantly consisting of lentils and rice. Its main ingredients are rice and black gram, ground together in a fine, smooth batter with a dash of salt, then fermented.', 'Dosa is high in carbohydrates and contains no added sugars or saturated fats. As its key ingredients are rice and black gram, it is also a good source of protein. One homemade plain dosa without oil contains about 112 calories, of which 84% is carbohydrate and 16% protein. The fermentation process increases the vitamin B and vitamin C content.', '3/4 cup Parboiled Rice (idli-dosa rice)\r\n3/4 cup Regular Rice\r\n1/2 cup Whole Urad Dal (without skin) or Split Urad Dal (black lentils)\r\n1/4 teaspoon Fenugreek Seeds (methi dana)\r\n1/2 tablespoon Chana Dal (gram lentils), optional\r\nWater, as needed\r\nSalt to taste\r\nOil, for shallow frying', 'dosa', 'south_indian', 'A mixture of rice and black or green gram that has been soaked in water is ground finely to form a batter. Some add a bit of soaked fenugreek seeds. The proportion of rice to lentils is generally 3:1 or 4:1. The batter is allowed to ferment overnight, before being mixed with water to get the desired consistency. The batter is then ladled onto a hot tava or griddle greased with oil or ghee. It is spread out with the base of a ladle or bowl to form a pancake. It can be made either to be thick like a pancake, or thin and crispy. A dosa is served hot, either folded in half or rolled like a wrap.'),
('Garlic naan', 262, 'Garlic naan an extremely popular Indian flatbread recipe made with plain flour and garlic. it is humungously popular across India and also all over the globe, mainly because of the flavour and taste. the bread tastes amazingly well with the choice of north Indian or Punjabi curries and can be easily served for lunch and dinner.', 'Total Fat 5.1ggrams\r\nSaturated Fat 1.3ggrams\r\nTrans Fat 0ggrams\r\nPolyunsaturated Fat 1.9ggrams\r\nMonounsaturated Fat 1.6ggrams\r\nSodium 419mgmilligrams\r\nPotassium 113mgmilligrams\r\nTotal Carbohydrates 45ggrams\r\nDietary Fiber 2ggrams\r\nSugars 3.2ggrams\r\nProtein 8.7g', '2 cup maida / plain flour\r\n tsp baking soda\r\n1 tsp baking powder\r\n tsp salt\r\n2 tbsp oil\r\n cup curd / yogurt\r\n1 tsp garlic (grated)\r\nwater (for kneading)\r\nfor garlic butter:\r\n3 tbsp butter (melted)\r\n1 tsp garlic (grated)\r\n2 tbsp coriander (finely chopped)', 'garlic_naan', 'north_indian', 'firstly, in a large mixing bowl take 2 cup maida,  tsp baking soda and 1 tsp baking powder and  tsp salt. mix well.\r\nadd 2 tbsp oil,  cup curd and 1 tsp garlic.\r\nmix well making sure everything is well combined.\r\nfurther, add water as required and knead to a smooth and soft dough.\r\ngrease the dough with oil, cover and rest for 2 hours.\r\nmeanwhile prepare garlic butter by mixing 3 tbsp butter, 1 tsp garlic and 2 tbsp coriander.\r\nafter 2 hours, knead the dough slightly. to remove if any air present in the dough. pinch a ball sized dough.\r\ngently roll to oval shape using a rolling pin. make sure you do not make too thin nor thick. and also keep the size in mind. it should not be larger than your tawa size.\r\ngrease with water over naan. make sure you coat uniformly. this helps naan to stick on tawa.\r\nfurthermore, slowly flip over and put it on hot tawa. remember, be gentle and put the water coated side down to tawa. also do not use nonstick tawa.\r\nslightly press. this helps the naan to stick on to the tawa and when you flip the tawa upside down it will be intact.\r\nnow after a minute, flip the tawa upside down and cook naan directly on flame till they turn golden brown.\r\nalso brush with some prepared garlic butter mixed with coriander leaves.\r\ngently scrape the naan from the bottom and remove.\r\nfinally, serve garlic naan hot with your favourite curry like mattar paneer.\r\n');
