d when you flip the tawa upside down it will be intact.\r\nnow after a minute, flip the tawa upside down and cook naan directly on flame till they turn golden brown.\r\nalso brush with some prepared garlic butter mixed with coriander leaves.\r\ngently scrape the naan from the bottom and remove.\r\nfinally, serve garlic naan hot with your favourite curry like mattar paneer.\r\n\"},{\"name\":\"dosa\",\"calorie\":\"112\",\"description\":\"A dosa / dosai / dosey is a thin batter-based dish (usually crispy) originating from South India, made from a fermented batter predominantly consisting of lentils and rice. Its main ingredients are rice and black gram, ground together in a fine, smooth batter with a dash of salt, then fermented.\",\"nutrients\":\"Dosa is high in carbohydrates and contains no added sugars or saturated fats. As its key ingredients are rice and black gram, it is also a good source of protein. One homemade plain dosa without oil contains about 112 calories, of which 84% is carbohydrate and 16% protein. The fermentation process increases the vitamin B and vitamin C content.\",\"ingredients\":\"3/4 cup Parboiled Rice (idli-dosa rice)\r\n3/4 cup Regular Rice\r\n1/2 cup Whole Urad Dal (without skin) or Split Urad Dal (black lentils)\r\n1/4 teaspoon Fenugreek Seeds (methi dana)\r\n1/2 tablespoon Chana Dal (gram lentils), optional\r\nWater, as needed\r\nSalt to taste\r\nOil, for shallow frying\",\"quantity\":\"1 nos\",\"photo\":\"/9j/4AAQSkZJRgABAQAAAQABAAD/4gIoSUNDX1BST0ZJTEUAAQEAAAIYAAAAAAIQAABtbnRyUkdC\nIFhZWiAAAAAAAAAAAAAAAABhY3NwAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAQAA9tYAAQAA\nAADTLQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAlk\nZXNjAAAA8AAAAHRyWFlaAAABZAAAABRnWFlaAAABeAAAABRiWFlaAAABjAAAABRyVFJDAAABoAAA\nAChnVFJDAAABoAAAAChiVFJDAAABoAAAACh3dHB0AAAByAAAABRjcHJ0AAAB3AAAADxtbHVjAAAA\nAAAAAAEAAAAMZW5VUwAAAFgAAAAcAHMAUgBHAEIAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA\nAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAFhZW