the tawa and when you flip the tawa upside down it will be intact.\r\nnow after a minute, flip the tawa upside down and cook naan directly on flame till they turn golden brown.\r\nalso brush with some prepared garlic butter mixed with coriander leaves.\r\ngently scrape the naan from the bottom and remove.\r\nfinally, serve garlic naan hot with your favourite curry like mattar paneer.\r\n\"},{\"name\":\"Garlic naan\",\"calorie\":\"262\",\"description\":\"Garlic naan an extremely popular Indian flatbread recipe made with plain flour and garlic. it is humungously popular across India and also all over the globe, mainly because of the flavour and taste. the bread tastes amazingly well with the choice of north Indian or Punjabi curries and can be easily served for lunch and dinner.\",\"nutrients\":\"Total Fat 5.1ggrams\r\nSaturated Fat 1.3ggrams\r\nTrans Fat 0ggrams\r\nPolyunsaturated Fat 1.9ggrams\r\nMonounsaturated Fat 1.6ggrams\r\nSodium 419mgmilligrams\r\nPotassium 113mgmilligrams\r\nTotal Carbohydrates 45ggrams\r\nDietary Fiber 2ggrams\r\nSugars 3.2ggrams\r\nProtein 8.7g\",\"ingredients\":\"2 cup maida / plain flour\r\n tsp baking soda\r\n1 tsp baking powder\r\n tsp salt\r\n2 tbsp oil\r\n cup curd / yogurt\r\n1 tsp garlic (grated)\r\nwater (for kneading)\r\nfor garlic butter:\r\n3 tbsp butter (melted)\r\n1 tsp garlic (grated)\r\n2 tbsp coriander (finely chopped)\",\"quantity\":\"2 nos\",\"photo\":\"/9j/4AAQSkZJRgABAQAAAQABAAD/4gIoSUNDX1BST0ZJTEUAAQEAAAIYAAAAAAIQAABtbnRyUkdC\nIFhZWiAAAAAAAAAAAAAAAABhY3NwAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAQAA9tYAAQAA\nAADTLQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAlk\nZXNjAAAA8AAAAHRyWFlaAAABZAAAABRnWFlaAAABeAAAABRiWFlaAAABjAAAABRyVFJDAAABoAAA\nAChnVFJDAAABoAAAAChiVFJDAAABoAAAACh3dHB0AAAByAAAABRjcHJ0AAAB3AAAADxtbHVjAAAA\nAAAAAAEAAAAMZW5VUwAAAFgAAAAcAHMAUgBHAEIAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA\nAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAFhZWiAA\nAAAAAABvogAAOPUAAAOQWFlaIAAAAAAA